import './App.css';
import Home from './pages/Home';
import Files from './pages/Files';
import { BrowserRouter as Router, Routes,Route, Link } from 'react-router-dom';

function App() {
  return (
    <Router>
      <div>
        <nav>
          <ul>
            <li>
              <Link to="/">home</Link>
            </li>
            <li>
              <Link to="/files">files</Link>
            </li>
          </ul>
        </nav>

        <Routes>
          <Route path="/files">
            <Files/>
          </Route>
          <Route path="/">
            <Home/>
          </Route>
        </Routes>
      </div>
    </Router>
  );
}

export default App;
